INSERT INTO `ai_playerbot_help_texts` (`id`, `name`, `template_changed`, `template_text`, `text`, `text_loc1`, `text_loc2`, `text_loc3`, `text_loc4`, `text_loc5`, `text_loc6`, `text_loc7`, `text_loc8`, `locs_updated`) VALUES
	(1, 'help:main', 0, '----This is the main help page----\r\nPlease copy a link to get more information about a topic.\r\nObjects: [h:object:strategy|strategies][h:object:trigger|triggers][h:object:action|actions][h:object:value|values][h:object:chatfilter|chatfilters]', '', '', '', '', '', '', '', '', '', 0),
	(2, 'object:strategy', 0, 'Strategies are rules that controle bot behavior. They combine [h:object:trigger|triggers] and [h:object:action|actions].\r\nStrategies: [h:list:generic strategy|general]\r\n[h:list:warrior strategy|warrior][h:list:paladin strategy|paladin][h:list:hunter strategy|hunter]\r\n[h:list:rogue strategy|rogue][h:list:priest strategy|priest][h:list:deathknight strategy|deathknight]\r\n[h:list:shaman strategy|shaman][h:list:mage strategy|mage][h:list:warlock strategy|warlock][h:list:druid strategy|druid]', '', '', '', '', '', '', '', '', '', 0),
	(3, 'object:trigger', 0, 'Triggers are conditions are evalated by the bot which helps it decide what to do. \r\nA [h:object|strategy] will enable a trigger and combine it with one or multiple [h:object:action|actions] which results in bot behavior. \r\nTriggers: [h:list:generic trigger|general]\r\n[h:list:warrior trigger|warrior][h:list:paladin trigger|paladin][h:list:hunter trigger|hunter]\r\n[h:list:rogue trigger|rogue][h:list:priest trigger|priest][h:list:deathknight trigger|deathknight]\r\n[h:list:shaman trigger|shaman][h:list:mage trigger|mage][h:list:warlock trigger|warlock][h:list:druid trigger|druid]', '', '', '', '', '', '', '', '', '', 0),
	(4, 'object:action', 0, 'Actions are specific interactions the bot can have with the world or itself. \r\nUsually the result of a [h:object|trigger] enabled by a [h:object|strategy].\r\nTriggers: [h:list:generic action|general]\r\n[h:list:warrior action|warrior][h:list:paladin action|paladin][h:list:hunter action|hunter]\r\n[h:list:rogue action|rogue][h:list:priest action|priest][h:list:deathknight action|deathknight]\r\n[h:list:shaman action|shaman][h:list:mage action|mage][h:list:warlock action|warlock][h:list:druid action|druid]', '', '', '', '', '', '', '', '', '', 0),
	(5, 'object:value', 1, 'Values are pieces of information the bot has about itself or the world.\r\nThey are used in [h:object:trigger|triggers] and [h:object:action|actions] for evaluation purposes.\r\nValues:[h:list|rpg value] [h:list|other value] ', '', '', '', '', '', '', '', '', '', 0),
	(6, 'template:strategy', 0, '<name> [h:object|strategy] [c:co ~<name>|toggle combat][c:nc ~<name>|toggle noncombat]\r\n<description><related><behavior>', '', '', '', '', '', '', '', '', '', 0),
	(7, 'template:trigger', 0, '<name> [h:object|trigger] [c:<name>|trigger now]\r\n<description><used trig><used val><behavior>', '', '', '', '', '', '', '', '', '', 0),
	(8, 'template:action', 0, '<name> [h:object|action] [c:do <name>|execute]\r\n<description><used act><used val><behavior>', '', '', '', '', '', '', '', '', '', 0),
	(9, 'template:value', 0, '<name> [h:object|value] [c:cdebug values <name>|current value]\r\n<description><used val><used in trig><used in act><used in val>', '', '', '', '', '', '', '', '', '', 0),
	(10, 'object:chatfilter', 1, 'Chatfilters is a bot selection mechanism that can be precede a chat command to only reach specific bots.\r\nExample "@<filter> who" will only make bots who fit the filter respond.\r\nMultiple filters can be used at the same time.\r\nFilters:[h:chatfilter|strategy] [h:chatfilter|class] [h:chatfilter|rti] [h:chatfilter|combat] [h:chatfilter|level] [h:chatfilter|group] [h:chatfilter|guild] [h:chatfilter|state] ', '', '', '', '', '', '', '', '', '', 0),
	(11, 'template:chatfilter', 0, '<name> [h:object|chatfilter]\r\n<description>\r\nExamples:\r\n<examples>', '', '', '', '', '', '', '', '', '', 0),
	(12, 'trigger:warrior pummel', 1, 'pummel [h:object|trigger] [c:pummel|trigger now]\r\n\r\nCombat behavior:\r\nExecutes: [h:action:warrior pummel|pummel] (40.000) for [h:strategy:warrior fury|fury]', '', '', '', '', '', '', '', '', '', 0),
	(13, 'strategy:arena', 1, 'arena [h:object|strategy] [c:co ~arena|toggle combat][c:nc ~arena|toggle noncombat]\r\nThis strategy controls the behavior arena fight.\r\nRelated strategies:\r\n[h:strategy|battleground] [h:strategy|bg] \r\nCombat behavior:\r\nOn: [h:trigger|no possible targets] do [h:action|arena tactics] (1.000)\r\nNon combat behavior:\r\nOn: [h:trigger|no possible targets] do [h:action|arena tactics] (1.000)', '', '', '', '', '', '', '', '', '', 0),
	(14, 'trigger:paladin target low health', 1, 'target low health [h:object|trigger] [c:target low health|trigger now]\r\n\r\nCombat behavior:\r\nExecutes: [h:action:paladin hammer of wrath|hammer of wrath] (41.000) for [h:strategy:paladin dps|dps]\r\nExecutes: [h:action:paladin hammer of wrath|hammer of wrath] (80.000) for [h:strategy:paladin tank|tank]', '', '', '', '', '', '', '', '', '', 0),
	(15, 'trigger:warrior battle stance', 1, 'battle stance [h:object|trigger] [c:battle stance|trigger now]\r\n\r\nCombat behavior:\r\nExecutes: [h:action:warrior battle stance|battle stance] (29.000) for [h:strategy:warrior arms|arms]\r\nNon combat behavior:\r\nExecutes: [h:action:warrior battle stance|battle stance] (1.000) for [h:strategy:warrior nc|nc]', '', '', '', '', '', '', '', '', '', 0),
	(16, 'strategy:group', 1, 'group [h:object|strategy] [c:co ~group|toggle combat][c:nc ~group|toggle noncombat]\r\n\r\nNon combat behavior:\r\nOn: [h:trigger|often] do [h:action|invite nearby] (4.000)\r\nOn: [h:trigger|random] do [h:action|invite guild] (4.000)\r\nOn: [h:trigger|seldom] do [h:action|leave far away] (4.000)\r\nOn: [h:trigger|leader is afk] do [h:action|leave far away] (4.000)', '', '', '', '', '', '', '', '', '', 0),
	(17, 'action:talk', 1, 'talk [h:object|action] [c:do talk|execute]\r\n\r\nNon combat behavior:\r\nTriggers from: [h:trigger|seldom] with relevance (1.000) for [h:strategy|emote]', '', '', '', '', '', '', '', '', '', 0),
	(18, 'action:shaman cleanse spirit', 1, 'cleanse spirit [h:object|action] [c:do cleanse spirit|execute]\r\n\r\nCombat behavior:\r\nTriggers from: [h:trigger:shaman cleanse spirit|cleanse spirit] with relevance (24.000) for [h:strategy:shaman cure|cure]\r\nTriggers from: [h:trigger:shaman cleanse spirit|cleanse spirit] with relevance (24.000) for [h:strategy:shaman cure|cure]\r\nTriggers from: [h:trigger:shaman cleanse spirit|cleanse spirit] with relevance (24.000) for [h:strategy:shaman cure|cure]\r\nNon combat behavior:\r\nTriggers from: [h:trigger:shaman cleanse spirit|cleanse spirit] with relevance (24.000) for [h:strategy:shaman cure|cure]\r\nTriggers from: [h:trigger:shaman cleanse spirit|cleanse spirit] with relevance (24.000) for [h:strategy:shaman cure|cure]\r\nTriggers from: [h:trigger:shaman cleanse spirit|cleanse spirit] with relevance (24.000) for [h:strategy:shaman cure|cure]', '', '', '', '', '', '', '', '', '', 0),
	(19, 'trigger:paladin repentance on snare target on snare target', 1, 'repentance on snare target on snare target [h:object|trigger] [c:repentance on snare target on snare target|trigger now]\r\n\r\nCombat behavior:\r\nExecutes: [h:action:paladin repentance on snare target|repentance on snare target] (42.000) for [h:strategy:paladin dps|dps]', '', '', '', '', '', '', '', '', '', 0),
	(20, 'strategy:mage bmana', 1, 'bmana [h:object|strategy] [c:co ~bmana|toggle combat][c:nc ~bmana|toggle noncombat]\r\n\r\nCombat behavior:\r\nOn: [h:trigger:mage mage armor|mage armor] do [h:action:mage mage armor|mage armor] (19.000)\r\nNon combat behavior:\r\nOn: [h:trigger:mage mage armor|mage armor] do [h:action:mage mage armor|mage armor] (19.000)', '', '', '', '', '', '', '', '', '', 0),
	(21, 'action:drop quest', 1, 'drop quest [h:object|action] [c:do drop quest|execute]\r\n\r\nCombat behavior:\r\nTriggers from: [h:trigger|drop] with relevance (100.000) for [h:strategy|chat]\r\nNon combat behavior:\r\nTriggers from: [h:trigger|drop] with relevance (100.000) for [h:strategy|chat]\r\nDead state behavior:\r\nTriggers from: [h:trigger|drop] with relevance (100.000) for [h:strategy|chat]', '', '', '', '', '', '', '', '', '', 0),
	(22, 'action:shaman cure disease', 1, 'cure disease [h:object|action] [c:do cure disease|execute]\r\n\r\nCombat behavior:\r\nTriggers from: [h:trigger:shaman cure disease|cure disease] with relevance (31.000) for [h:strategy:shaman cure|cure]\r\nNon combat behavior:\r\nTriggers from: [h:trigger:shaman cure disease|cure disease] with relevance (31.000) for [h:strategy:shaman cure|cure]\r\nTriggers from: [h:trigger:shaman cure disease|cure disease] with relevance (31.000) for [h:strategy:shaman nc|nc]', '', '', '', '', '', '', '', '', '', 0),
	(23, 'action:deathknight howling blast', 1, 'howling blast [h:object|action] [c:do howling blast|execute]\r\n\r\nCombat behavior:\r\nTriggers from: [h:trigger:deathknight aoe|aoe] with relevance (15.000) for [h:strategy:deathknight blood|blood]\r\nTriggers from: [h:trigger:deathknight aoe|aoe] with relevance (15.000) for [h:strategy:deathknight frost|frost]\r\nTriggers from: [h:trigger:deathknight aoe|aoe] with relevance (14.000) for [h:strategy:deathknight frost aoe|frost aoe]\r\nTriggers from: [h:trigger:deathknight aoe|aoe] with relevance (15.000) for [h:strategy:deathknight blood|blood]\r\nTriggers from: [h:trigger:deathknight aoe|aoe] with relevance (15.000) for [h:strategy:deathknight unholy|unholy]', '', '', '', '', '', '', '', '', '', 0),
	(24, 'strategy:onyxia\'s lair', 1, 'onyxia\'s lair [h:object|strategy] [c:co ~onyxia\'s lair|toggle combat][c:nc ~onyxia\'s lair|toggle noncombat]\r\n\r\nCombat behavior:\r\nOn: [h:trigger|start onyxia fight] do [h:action|enable onyxia fight strategy] (100.000)', '', '', '', '', '', '', '', '', '', 0),
	(25, 'action:use meeting stone', 1, 'use meeting stone [h:object|action] [c:do use meeting stone|execute]\r\n\r\nCombat behavior:\r\nTriggers from: [h:trigger|use game object] with relevance (100.000) for [h:strategy|default]\r\nNon combat behavior:\r\nTriggers from: [h:trigger|use game object] with relevance (100.000) for [h:strategy|default]\r\nDead state behavior:\r\nTriggers from: [h:trigger|use game object] with relevance (100.000) for [h:strategy|default]', '', '', '', '', '', '', '', '', '', 0),
	(26, 'strategy:rpg explore', 1, 'rpg explore [h:object|strategy] [c:co ~rpg explore|toggle combat][c:nc ~rpg explore|toggle noncombat]\r\n\r\nNon combat behavior:\r\nOn: [h:trigger|rpg taxi] do [h:action|rpg taxi] (1.005)\r\nOn: [h:trigger|rpg discover] do [h:action|rpg discover] (1.110)\r\nOn: [h:trigger|rpg home bind] do [h:action|rpg home bind] (1.060)', '', '', '', '', '', '', '', '', '', 0),
	(27, 'action:shaman heroism', 1, 'heroism [h:object|action] [c:do heroism|execute]\r\n\r\nCombat behavior:\r\nTriggers from: [h:trigger:shaman heroism|heroism] with relevance (31.000) for [h:strategy:shaman caster|caster]\r\nTriggers from: [h:trigger:shaman heroism|heroism] with relevance (31.000) for [h:strategy:shaman melee|melee]\r\nTriggers from: [h:trigger:shaman heroism|heroism] with relevance (31.000) for [h:strategy:shaman melee|melee]\r\nTriggers from: [h:trigger:shaman heroism|heroism] with relevance (31.000) for [h:strategy:shaman heal|heal]\r\nTriggers from: [h:trigger:shaman heroism|heroism] with relevance (31.000) for [h:strategy:shaman totems|totems]', '', '', '', '', '', '', '', '', '', 0),
	(28, 'trigger:druid rake', 1, 'rake [h:object|trigger] [c:rake|trigger now]\r\n\r\nCombat behavior:\r\nExecutes: [h:action:druid rake|rake] (15.000) for [h:strategy:druid cat|cat]\r\nExecutes: [h:action:druid rake|rake] (15.000) for [h:strategy:druid cat|cat]', '', '', '', '', '', '', '', '', '', 0),
	(29, 'action:invite', 1, 'invite [h:object|action] [c:do invite|execute]\r\n\r\nCombat behavior:\r\nTriggers from: [h:trigger|invite] with relevance (100.000) for [h:strategy|chat]\r\nNon combat behavior:\r\nTriggers from: [h:trigger|invite] with relevance (100.000) for [h:strategy|chat]\r\nDead state behavior:\r\nTriggers from: [h:trigger|invite] with relevance (100.000) for [h:strategy|chat]', '', '', '', '', '', '', '', '', '', 0),
	(30, 'trigger:paladin hammer of justice on enemy', 1, 'hammer of justice on enemy [h:object|trigger] [c:hammer of justice on enemy|trigger now]\r\n\r\nCombat behavior:\r\nExecutes: [h:action:paladin hammer of justice|hammer of justice] (41.000) for [h:strategy:paladin dps|dps]\r\nExecutes: [h:action:paladin hammer of justice|hammer of justice] (41.000) for [h:strategy:paladin tank|tank]', '', '', '', '', '', '', '', '', '', 0),
	(31, 'action:rogue ambush', 1, 'ambush [h:object|action] [c:do ambush|execute]\r\n\r\nCombat behavior:\r\nTriggers from: [h:trigger:rogue trigger|trigger] with relevance (23.000) for [h:strategy:rogue stealthed|stealthed]', '', '', '', '', '', '', '', '', '', 0),
	(32, 'trigger:magmadar lava bomb', 1, 'magmadar lava bomb [h:object|trigger] [c:magmadar lava bomb|trigger now]\r\n\r\nReaction behavior:\r\nExecutes: [h:action|move away from magmadar lava bomb] (100.000) for [h:strategy|magmadar]', '', '', '', '', '', '', '', '', '', 0),
	(33, 'trigger:ah bid', 1, 'ah bid [h:object|trigger] [c:ah bid|trigger now]\r\n\r\nCombat behavior:\r\nExecutes: [h:action|ah bid] (100.000) for [h:strategy|chat]\r\nNon combat behavior:\r\nExecutes: [h:action|ah bid] (100.000) for [h:strategy|chat]\r\nDead state behavior:\r\nExecutes: [h:action|ah bid] (100.000) for [h:strategy|chat]', '', '', '', '', '', '', '', '', '', 0),
	(34, 'trigger:give water', 1, 'give water [h:object|trigger] [c:give water|trigger now]\r\n\r\nNon combat behavior:\r\nExecutes: [h:action:give water|give water] (14.000) for [h:strategy:mage buff|buff]', '', '', '', '', '', '', '', '', '', 0),
	(35, 'value:bg type', 1, 'bg type [h:object|value] [c:cdebug values bg type|current value]\r\n', '', '', '', '', '', '', '', '', '', 0),
	(36, 'strategy:hunter bmana', 1, 'bmana [h:object|strategy] [c:co ~bmana|toggle combat][c:nc ~bmana|toggle noncombat]\r\n\r\nCombat behavior:\r\nOn: [h:trigger:hunter aspect of the viper|aspect of the viper] do [h:action:hunter aspect of the viper|aspect of the viper] (10.000)\r\nNon combat behavior:\r\nOn: [h:trigger:hunter aspect of the viper|aspect of the viper] do [h:action:hunter aspect of the viper|aspect of the viper] (10.000)', '', '', '', '', '', '', '', '', '', 0),
	(37, 'action:deathknight improved icy talons', 1, 'improved icy talons [h:object|action] [c:do improved icy talons|execute]\r\n\r\nCombat behavior:\r\nTriggers from: [h:trigger:deathknight improved icy talons|improved icy talons] with relevance (19.000) for [h:strategy:deathknight bdps|bdps]\r\nNon combat behavior:\r\nTriggers from: [h:trigger:deathknight improved icy talons|improved icy talons] with relevance (19.000) for [h:strategy:deathknight bdps|bdps]', '', '', '', '', '', '', '', '', '', 0),
	(38, 'strategy:close', 1, 'close [h:object|strategy] [c:co ~close|toggle combat][c:nc ~close|toggle noncombat]\r\n\r\nCombat behavior:\r\nOn: [h:trigger|invalid target] do [h:action|select new target] (89.000)\r\nOn: [h:trigger|mounted] do [h:action|check mount state] (88.000)\r\nOn: [h:trigger|enemy out of melee range] do [h:action|reach melee] (60.000)\r\nOn: [h:trigger|out of react range] do [h:action|flee to master] (55.000)\r\nOn: [h:trigger|combat long stuck] do [h:action|hearthstone] (0.900)[h:action|repop] (0.800)\r\nOn: [h:trigger|very often] do [h:action|lightwell] (80.000)[h:action|adamantite grenade] (61.000)\r\nOn: [h:trigger|often] do [h:action|use trinket] (50.000)\r\nOn: [h:trigger|enemy too close for melee] do [h:action|move out of enemy contact] (18.000)', '', '', '', '', '', '', '', '', '', 0),
	(39, 'trigger:stats', 1, 'stats [h:object|trigger] [c:stats|trigger now]\r\n\r\nCombat behavior:\r\nExecutes: [h:action|stats] (100.000) for [h:strategy|chat]\r\nNon combat behavior:\r\nExecutes: [h:action|stats] (100.000) for [h:strategy|chat]\r\nDead state behavior:\r\nExecutes: [h:action|stats] (100.000) for [h:strategy|chat]', '', '', '', '', '', '', '', '', '', 0),
	(40, 'strategy:druid caster', 1, 'caster [h:object|strategy] [c:co ~caster|toggle combat][c:nc ~caster|toggle noncombat]\r\n\r\nCombat behavior:\r\nOn: [h:trigger:party member low health|party member low health] do [h:action:druid regrowth on party|regrowth on party] (71.000)\r\nOn: [h:trigger:invalid target|invalid target] do [h:action:select new target|select new target] (89.000)\r\nOn: [h:trigger:druid enemy out of spell range|enemy out of spell range] do [h:action:reach spell|reach spell] (30.000)\r\nOn: [h:trigger:druid entangling roots on snare target|entangling roots on snare target] do [h:action:druid entangling roots on snare target|entangling roots on snare target] (25.000)\r\nOn: [h:trigger:low health|low health] do [h:action:druid regrowth|regrowth] (72.000)\r\nOn: [h:trigger:mounted|mounted] do [h:action:check mount state|check mount state] (88.000)\r\nOn: [h:trigger:out of react range|out of react range] do [h:action:flee to master|flee to master] (55.000)\r\nOn: [h:trigger:very often|very often] do [h:action:lightwell|lightwell] (80.000)[h:action:adamantite grenade|adamantite grenade] (61.000)\r\nOn: [h:trigger:often|often] do [h:action:use trinket|use trinket] (50.000)\r\nOn: [h:trigger:combat long stuck|combat long stuck] do [h:action:hearthstone|hearthstone] (0.900)[h:action:repop|repop] (0.800)\r\nOn: [h:trigger:critical health|critical health] do [h:action:druid regrowth|regrowth] (82.000)[h:action:druid healing touch|healing touch] (81.000)\r\nOn: [h:trigger:party member critical health|party member critical health] do [h:action:druid regrowth on party|regrowth on party] (82.000)[h:action:druid healing touch on party|healing touch on party] (81.000)\r\nOn: [h:trigger:resurrect|resurrect] do [h:action:druid rebirth|rebirth] (21.000)\r\nOn: [h:trigger:low mana|low mana] do [h:action:druid innervate|innervate] (25.000)\r\nOn: [h:trigger:player has flag|player has flag] do [h:action:druid travel form|travel form] (92.000)\r\nOn: [h:trigger:party member medium health|party member medium health] do [h:action:druid regrowth on party|regrowth on party] (71.000)\r\nOn: [h:trigger:medium health|medium health] do [h:action:druid regrowth|regrowth] (72.000)\r\nOn: [h:trigger:almost full health|almost full health] do [h:action:druid rejuvenation|rejuvenation] (62.000)\r\nOn: [h:trigger:party member almost full health|party member almost full health] do [h:action:druid rejuvenation on party|rejuvenation on party] (61.000)\r\nOn: [h:trigger:druid insect swarm|insect swarm] do [h:action:druid insect swarm|insect swarm] (15.000)\r\nOn: [h:trigger:druid moonfire|moonfire] do [h:action:druid moonfire|moonfire] (14.000)\r\nOn: [h:trigger:druid eclipse (solar)|eclipse (solar)] do [h:action:druid wrath|wrath] (16.000)\r\nOn: [h:trigger:druid eclipse (lunar)|eclipse (lunar)] do [h:action:druid starfire|starfire] (16.000)\r\nOn: [h:trigger:enemy five yards|enemy five yards] do [h:action:druid nature\'s grasp|nature\'s grasp] (90.000)\r\nDefault:[h:action:druid wrath|wrath] (11.000)[h:action:druid starfire|starfire] (12.000)', '', '', '', '', '', '', '', '', '', 0),
	(41, 'action:rpg trade useful', 1, 'rpg trade useful [h:object|action] [c:do rpg trade useful|execute]\r\n\r\nNon combat behavior:\r\nTriggers from: [h:trigger|rpg trade useful] with relevance (1.030) for [h:strategy|rpg player]', '', '', '', '', '', '', '', '', '', 0),
	(42, 'trigger:priest fear ward', 1, 'fear ward [h:object|trigger] [c:fear ward|trigger now]\r\n\r\nNon combat behavior:\r\nExecutes: [h:action:priest fear ward|fear ward] (10.000) for [h:strategy:priest buff|buff]', '', '', '', '', '', '', '', '', '', 0),
	(43, 'strategy:onyxia', 1, 'onyxia [h:object|strategy] [c:co ~onyxia|toggle combat][c:nc ~onyxia|toggle noncombat]\r\n\r\nNon combat behavior:\r\nOn: [h:trigger|end onyxia fight] do [h:action|disable onyxia fight strategy] (100.000)\r\nDead state behavior:\r\nOn: [h:trigger|end onyxia fight] do [h:action|disable onyxia fight strategy] (100.000)', '', '', '', '', '', '', '', '', '', 0),
	(44, 'strategy:dead', 1, 'dead [h:object|strategy] [c:co ~dead|toggle combat][c:nc ~dead|toggle noncombat]\r\nThis strategy will includes various behavior when the bot is dead.\r\n The main goal is to revive in a safe location.\r\nDead state behavior:\r\nOn: [h:trigger|very often] do [h:action|auto release] (100.000)\r\nOn: [h:trigger|dead] do [h:action|find corpse] (100.000)\r\nOn: [h:trigger|corpse near] do [h:action|revive from corpse] (99.000)\r\nOn: [h:trigger|resurrect request] do [h:action|accept resurrect] (100.000)\r\nOn: [h:trigger|falling far] do [h:action|repop] (101.000)', '', '', '', '', '', '', '', '', '', 0),
	(45, 'action:clean quest log', 1, 'clean quest log [h:object|action] [c:do clean quest log|execute]\r\n\r\nNon combat behavior:\r\nTriggers from: [h:trigger|random] with relevance (6.000) for [h:strategy|maintenance]', '', '', '', '', '', '', '', '', '', 0),
