	(1616, 'chatfilter:strategy', 1, 'strategy [h:object|chatfilter]\r\nThis filter selects bots with a specific role or weapon range.\r\nExamples:\r\n@tank: All bots that have a tank spec.\r\n@ranged: All bots that use ranged attacks.\r\n@dps: All bots that do not have a tank or healing spec.\r\n@heal: All bots that have a healing spec.\r\n@notank: All bots that do not have a tank spec.\r\n@melee: All bots that use melee attacks.\r\n@nodps: All bots that have a tank or healing spec.\r\n@noheal: All bots that do not have a healing spec.', '', '', '', '', '', '', '', '', '', 0),
	(1617, 'chatfilter:class', 1, 'class [h:object|chatfilter]\r\nThis filter selects bots have a certain class.\r\nExamples:\r\n@rogue: All rogue bots.\r\n@warlock: All warlock bots.', '', '', '', '', '', '', '', '', '', 0),
	(1618, 'chatfilter:guild', 1, 'guild [h:object|chatfilter]\r\nThis filter selects bots based on their guild.\r\nExamples:\r\n@guild: All bots in a guild.\r\n@guild=raiders: All bots in guild raiders.\r\n@noguild: All bots not in a guild.\r\n@gleader: All bots that are a guild leader.\r\n@grank=Initiate: All bots that have rank Initiate in their guild.', '', '', '', '', '', '', '', '', '', 0),
	(1619, 'chatfilter:state', 1, 'state [h:object|chatfilter]\r\nThis filter selects bots based on their state.\r\nExamples:\r\n@outside: All bots that are outside of an instance.\r\n@needrepair: All bots that have durability below 20%.\r\n@inside: All bots that are inside an instance.', '', '', '', '', '', '', '', '', '', 0);
